import React from 'react'
import Radium from 'radium'
import toggleIconDecorator from '../decorators/toggleIconDecorator'
import addArticleIcon from '../create-article.svg'

const ToggleCreate = ( ) => {

	const style ={
		opacity: 1,
		':active':{
			opacity: 0.5
		},
		':visited':{
			opacity: 0.1
		},
	}

	return(
		<button className='icon-style' style={style}>			
		  <div>
			<img src={addArticleIcon} alt="search-icon"/>
		  </div>
		</button> 
	)

}
export default Radium(ToggleCreate)
